import React from "react";

import "./form-input.styles.scss";

const FormInput = ({ handleChange, label, ...otherData }) => {
  <div className="group">
    <input className="form-input" onChange={handleChange} {...otherData} />
    <label>{label}</label>
  </div>;
};

export default FormInput;
